// App.js
import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app-container">
      <div className="header">
        <h1 className="header-txt">To Do</h1>
      </div>
      <div className="container">
        <p>Your container content goes here.</p>
      </div>
    </div>
  );
}

export default App;
